import "./App.css";
import styled from "styled-components";
import Sidebar from "./components/layout/Sidebar";

const Container = styled.div`
  background-color: #f0f2f5;
  height: 100%;
`;

const App = () => {
  return (
    <Container>
      <Sidebar />
    </Container>
  );
};

export default App;
